base64imgs = function(img) {
  switch (img) {
    case 'login-background':
      return 'data:image/jpeg;base64,';
      break;      
    case 'partio_logo':
      return 'data:image/png;base64,';
      break;
    case 'share-hand':  
        return 'data:image/png;base64,';
        break;
    case 'borrow-hand':
        return 'data:image/png;base64,';
        break;      
    case 'sidemenu-logo': 
        return 'data:image/png;base64,';
        break;
    case 'spinner-logo':
        return 'data:image/png;base64,';
        break;
    case 'image-not-available':
          return 'data:image/png;base64,';
          break;
    default:
      return '';
  }
}
